0"},"volume_range":{"id":"1996607"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1996790","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"w/UoXI8iREDNzMzMzMxDQGZmZmZmpkNAH4XrUbjeQ0AAAAAAAMBDQOF6FK5HQURAj8L1KFyPREAAAAAAAOBEQOF6FK5HoUVAAAAAAAAgTEBxPQrXo3BMQHsUrkfh2k1AH4XrUbieTEAzMzMzM5NMQMP1KFyPIkxAexSuR+HaS0BSuB6F63FLQGZmZmZmJk1ApHA9CtfjTEAAAAAAAEBNQClcj8L1KE1Aw/UoXI/iTEBSuB6F6/FMQFK4HoXr0UxAPQrXo3D9S0AK16NwPapLQAAAAAAAoEtAAAAAAADAS0A9CtejcF1MQHE9CtejEExAmpmZmZlZSkBmZmZmZqZKQHsUrkfhukpAmpmZmZl5SkA9CtejcD1KQNejcD0Kd0pAKVyPwvWISkCamZmZmXlJQD0K16NwPUpAmpmZmZl5SkA9CtejcH1KQGZmZmZmZklACtejcD0KSUBxPQrXo1BJQHsUrkfhGklAexSuR+FaSECamZmZmZlIQEjhehSuR0hAexSuR+FaSEBcj8L1KDxIQOF6FK5HYUdAexSuR+H6R0DXo3A9CvdIQOxRuB6FK0lASOF6FK6HSUBmZmZmZqZJQI/C9Shcz0lAhetRuB4FSkAfhet
